const ExpandableSearch = ({
    placeholder,
    ...props
}) => {
    return <div className="expandableSearchContainer">
        <input
            type="text"
            {...props}
        />
        <style jsx>{`${style}`}</style>
    </div>
};
export default ExpandableSearch;
